description:
Diana Prince, Phoenix Marie, Presley Hart, Avril Hall
Evan Stone, Mr. Pete, Manuel Ferrara, Dane Cross

After Evan's son, Dane, strikes out with Avril, Evan
decides to show off his charming maturity to the sexy
young barmaid. Dejected Dane finds comfort with sexy
Milf Diana, who takes him to her room for a new shot
of confidence. Bad boy Pete's hot on the trail for
some hot young maid, but it's feisty older Phoenix who
entraps the young buck. Presley the maid has just
turned down Pete, because it's Pete's father Manuel
whom she has her eyes on
